import React from "react";
import { useEffect, useState } from "react";
import { Button, SideBar } from "./component/Component";
import { useNavigate } from "react-router-dom";

function Dashboard() {
    const navigate = useNavigate();
    const [nav , setNav] = useState(false);

    const toggleNav = () => {
        setNav(!nav);
    }
    useEffect(() => {
        if (localStorage.getItem("isLogin") !== "true") {
            window.location.href = "/";
        }
    }, []);
    const logot = () => {
        localStorage.setItem("isLogin", "false");
        localStorage.removeItem("username");
        navigate("/");
    }
    return(
        <div className="w-full h-screen flex justify-center items-center bg-gray-300">
            <div className={`w-1/6 fixed left-0`}>
                <SideBar nav={nav}/>
            </div>
            <div className="w-5/6 ml-64 h-full flex">
                <div className="w-full pt-4 flex justify-between">
                    <div>
                        <Button color onClick={toggleNav}>
                            <i className="bi bi-list text-2xl"></i>
                        </Button>
                    </div>
                    <h1 className="text-3xl font-bold mb-4">Dashboard</h1>
                    <p className="text-lg mb-4">Welcome, {localStorage.getItem("username")}</p>
                </div>
            </div>
        </div>
    )
}
export default Dashboard;
